/* eslint-disable import/no-default-export,@typescript-eslint/no-explicit-any */
declare module '*.svg' {
  const content: string;
  export default content;
}

declare module '*.md' {
  const markdown: string;
  export default markdown;
}

declare module '*.jpg' {
  const data: any;
  export default data;
}

declare module '*.png' {
  const data: any;
  export default data;
}
